import React from 'react';

const TweetsList = ({tweets}) => (
    <>
    <h3>Tweets:</h3>
    {tweets.map((tweet, key) => (
        <div className="background:red;" key={key}>
            <h4>{tweet.id}</h4>
            <p>{tweet.text}</p>

        </div>
    ))}
    </>
)

export default TweetsList;
